import React, {Component} from 'react';
import {Link} from "react-router-dom";
import './Home.css';

class Home extends Component{
  render(){
    return (
      <div className="homeWrapper">
        <div className="box">
          <Link to="/parks" className="links">Explore More</Link>
        </div>
      </div>
    );
  }
}

export default Home;
